    // }

    logout = () => {
        localStorage.clear();
    }

    render() {
        if (!localStorage.token || localStorage.token === "undefined") {
            return <Redirect to="/login"/>
        }

        return (
            <section id="admin">
                <h1>This is the Admin Page</h1>
                <Link to={'/'}>Go to Site</Link>
                <button onClick={this.logout}>Log Out</button>
            </section>
        );
    }

}
export default Admin;
